import { useEffect } from "react"


export const CardName = ({name,callback}) =>{
    useEffect(() => { console.log("montou"); return () => {console.log("desmontou")}} ,[])

    return(
        <div>
            <h2>{name}</h2>
            <h3>{callback(5+4)}</h3>
        </div>
    )
}
